actionConfiguration.body:
endTimeString => {
  const timeMoment = moment(endTimeString);
  let hourToSet = 18;
  if (timeMoment.hours() <= 13) hourToSet = 12;
  timeMoment.set({
    hour: hourToSet,
    minute: 0,
    second: 0,
    milisecond: 0
  });
  return timeMoment.toLocaleString();
}

